{
  "name": "UBX-CFG-GNSS",
  "class_id": "0x06",
  "message_id": "0x3e",
  "description": "GNSS system configuration",
  "message_type": "get_set",
  "payload_length": {
    "variable": {
      "base": 4,
      "formula": "4 + numConfigBlocks * 8"
    }
  },
  "payload_fields": [
    {
      "byte_offset": 0,
      "name": "msgVer",
      "data_type": "U1",
      "description": "Message version (0x00 for this version)",
      "fixed_value": 0
    },
    {
      "byte_offset": 1,
      "name": "numTrkChHw",
      "data_type": "U1",
      "description": "Number of tracking channels available in hardware (read only)"
    },
    {
      "byte_offset": 2,
      "name": "numTrkChUse",
      "data_type": "U1",
      "description": "(Read only for protocol versions greater than 23.00) Number of tracking channels to use. Must be > 0, <= numTrkChHw. If 0xFF, then number of tracking channels to use will be set to numTrkChHw."
    },
    {
      "byte_offset": 3,
      "name": "numConfigBlocks",
      "data_type": "U1",
      "description": "Number of configuration blocks following"
    },
    {
      "byte_offset": 4,
      "name": "configBlocks",
      "data_type": {
        "array_of": {
          "byte_offset": 0,
          "name": "configBlock",
          "data_type": "block",
          "description": "GNSS configuration block",
          "payload_fields": [
            {
              "byte_offset": 0,
              "name": "gnssId",
              "data_type": "U1",
              "description": "System identifier (see Satellite Numbering)"
            },
            {
              "byte_offset": 1,
              "name": "resTrkCh",
              "data_type": "U1",
              "description": "(Read only for protocol versions greater than 23.00) Number of reserved (minimum) tracking channels for this system."
            },
            {
              "byte_offset": 2,
              "name": "maxTrkCh",
              "data_type": "U1",
              "description": "(Read only for protocol versions greater than 23.00) Maximum number of tracking channels used for this system. Must be > 0, >= resTrkChn, <= numTrkChUse and <= maximum number of tracking channels supported for this system."
            },
            {
              "byte_offset": 3,
              "name": "reserved0",
              "data_type": "U1",
              "description": "Reserved",
              "reserved": true
            },
            {
              "byte_offset": 4,
              "name": "flags",
              "data_type": "X4",
              "description": "Bitfield of flags. At least one signal must be configured in every enabled system.",
              "bitfield_fields": [
                {
                  "name": "enable",
                  "position": 0,
                  "length": 1,
                  "description": "Enable this system"
                },
                {
                  "name": "sigCfgMask",
                  "position": 16,
                  "length": 8,
                  "description": "Signal configuration mask. When gnssId is 0 (GPS): 0x01 = GPS L1C/A, 0x10 = GPS L2C, 0x20 = GPS L5. When gnssId is 1 (SBAS): 0x01 = SBAS L1C/A. When gnssId is 2 (Galileo): 0x01 = Galileo E1, 0x10 = Galileo E5a, 0x20 = Galileo E5b. When gnssId is 3 (BeiDou): 0x01 = BeiDou B1I, 0x10 = BeiDou B2I, 0x80 = BeiDou B2A. When gnssId is 4 (IMES): 0x01 = IMES L1. When gnssId is 5 (QZSS): 0x01 = QZSS L1C/A, 0x04 = QZSS L1S, 0x10 = QZSS L2C, 0x20 = QZSS L5. When gnssId is 6 (GLONASS): 0x01 = GLONASS L1, 0x10 = GLONASS L2."
                }
              ]
            }
          ]
        },
        "count_field": "numConfigBlocks"
      }
    }
  ]
}
